import {OperationResult, PopupContainer} from "./PopupStyled";
import React from "react";

interface PopupProps {
    popupFlag: boolean
}

const Popup = (props:PopupProps) => {
    return(
        <PopupContainer visible={props.popupFlag}>
            <OperationResult>Lorem ipsum dolor sit amet, consectetur adipisicing.</OperationResult>
        </PopupContainer>
    )
}

export default Popup
